import { React, Component } from 'react';

import { NavLink } from "react-router-dom";

import './styles/Header.css';
import './styles/Actions.css';
import './styles/Logo.css';
import './styles/Navigation.css';


class Header extends Component {

    render() {

      return (
        <div className='header'>
            <div className='navigation'>
              <li onClick={() => this.changeQuery("all")}><NavLink>All</NavLink></li>
              <li onClick={() => this.changeQuery("tech")}><NavLink>technologies</NavLink></li>
              <li onClick={() => this.changeQuery("clothes")}><NavLink>clothes</NavLink></li>
            </div>

            <div className='logo'>
                <img alt='logo' src='./a-logo.png' />
            </div>

            <div className='actions'>
            <select onChange={this.handleChange}>
              {currencyData}
            </select>
                <li onClick={() => this.openCloseCard(this.state.openClose)}><i className="fas fa-shopping-cart"></i></li>
            </div>

        </div>
      ) 
    }
  }

  export default Header;
